import React from 'react'
import { Button, Container,Row ,Col} from 'react-bootstrap';
import Carousel from 'react-bootstrap/Carousel'
export function BoCarousel() {
  return (
      <Carousel>
        <Carousel.Item>
          <Container></Container>
        </Carousel.Item>
    </Carousel>
  )
}

export default BoCarousel;
